    playbackData.comments = {"ev-0":[{"id":"commentId-0","displayCommentEvent":{"id":"ev-0","timestamp":1647376437027,"createdByDevGroupId":"devGroupId-1","eventSequenceNumber":0,"permanentRelevance":"never relevant","type":"CREATE DIRECTORY","directoryId":"dirId-0","directoryPath":"/","parentDirectoryId":null},"developerGroupId":"devGroupId-1","timestamp":1647383819640,"commentText":"<div>In this playback I will answer the question, \"How much available capacity is in each location?\"</div><div><br></div>The attached ER Diagram shows the relationship between the dogs and their locations.<br>","selectedCodeBlocks":[],"imageURLs":["media/images/1647383812320-IMG_C3ACA0E9D18F-1.jpeg"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"","viewableBlogText":"","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-52":[{"id":"commentId-1","displayCommentEvent":{"id":"ev-52","timestamp":1647376466101,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":52,"type":"INSERT","fileId":"fileId-0","character":";","previousNeighborId":"ev-51","lineNumber":3,"column":32,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1647377068226,"commentText":"I begin the query by finding all of the dogs that have not been adopted. Any dog that has a <font face=\"Courier\">NULL</font> value for the foreign key <font face=\"Courier\">adoptedByClientId</font> has not been adopted yet.<br>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"SELECT *\nFROM Dogs\nWHERE adoptedByClientId IS NULL;","startRow":0,"startColumn":0,"endRow":2,"endColumn":32}],"imageURLs":["media/images/1647376673208-Screen Shot 2022-03-15 at 3.37.38 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/q.sql","viewableBlogText":"SELECT *\nFROM Dogs\nWHERE adoptedByClientId IS NULL;","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-110":[{"id":"commentId-2","displayCommentEvent":{"id":"ev-110","timestamp":1647376488379,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":110,"type":"INSERT","fileId":"fileId-0","character":"D","previousNeighborId":"ev-109","lineNumber":4,"column":3,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1647383857380,"commentText":"Next, I join the Locations table to the results and display all the information about dogs and where they are housed.<br>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"Locations","startRow":1,"startColumn":11,"endRow":1,"endColumn":20},{"fileId":"fileId-0","selectedText":"Dogs.locationId = Locations.id","startRow":2,"startColumn":6,"endRow":2,"endColumn":36}],"imageURLs":["media/images/1647376799614-Screen Shot 2022-03-15 at 3.39.12 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"1","linesBelow":"1","currentFilePath":"/q.sql","viewableBlogText":"SELECT *\nFROM Dogs, Locations\nWHERE Dogs.locationId = Locations.id\nAND adoptedByClientId IS NULL;","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-173":[{"id":"commentId-3","displayCommentEvent":{"id":"ev-173","timestamp":1647376506373,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":173,"type":"INSERT","fileId":"fileId-0","character":"y","previousNeighborId":"ev-172","lineNumber":1,"column":68,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1647377168254,"commentText":"Here I limit the number of attributes being displayed.<br>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"Dogs.name, Locations.name AS loactionName, Locations.capacity","startRow":0,"startColumn":7,"endRow":0,"endColumn":68}],"imageURLs":["media/images/1647376862759-Screen Shot 2022-03-15 at 3.40.50 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"3","currentFilePath":"/q.sql","viewableBlogText":"SELECT Dogs.name, Locations.name AS loactionName, Locations.capacity\nFROM Dogs, Locations\nWHERE Dogs.locationId = Locations.id\nAND  adoptedByClientId IS NULL;","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-197":[{"id":"commentId-4","displayCommentEvent":{"id":"ev-197","timestamp":1647376523458,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":197,"type":"INSERT","fileId":"fileId-0","character":"e","previousNeighborId":"ev-196","lineNumber":5,"column":23,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1647383955181,"commentText":"<div>Next, I use <font face=\"Courier\">ORDER BY</font> to look at the groups of dogs at each location. Using <font face=\"Courier\">ORDER BY</font> I can see that there are six dogs in Kenosha South, for example. That location has a capacity to hold 12 dogs.<br></div><div><br></div><div>In the next step I'll change to <font face=\"Courier\">GROUP BY</font> and use an aggregate operator.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"ORDER BY Locations.name","startRow":4,"startColumn":0,"endRow":4,"endColumn":23}],"imageURLs":["media/images/1647376924525-Screen Shot 2022-03-15 at 3.41.37 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"4","linesBelow":"0","currentFilePath":"/q.sql","viewableBlogText":"SELECT Dogs.name, Locations.name AS loactionName, Locations.capacity\nFROM Dogs, Locations\nWHERE Dogs.locationId = Locations.id\nAND  adoptedByClientId IS NULL\nORDER BY Locations.name;","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-331":[{"id":"commentId-5","displayCommentEvent":{"id":"ev-331","timestamp":1647376551493,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":331,"type":"INSERT","fileId":"fileId-0","character":"y","previousNeighborId":"ev-330","lineNumber":1,"column":70,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1647384004742,"commentText":"<div>First, I <font face=\"Courier\">GROUP BY</font> the location name. Then I project out the location name and then I perform some arithmetic.</div><div><br></div><div>I take each location's capacity and subtract the number of dogs that have not been adopted and therefore are taking up a cage at the pet adoption center.</div><div><br></div><div>For example, in Kenosha South there is a capacity to hold 12 dogs but there are six dogs that have not been adopted. So, there is capacity to hold six more dogs there. <br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"Locations.name, (Locations.capacity - COUNT(*)) AS freeCapacity","startRow":0,"startColumn":7,"endRow":0,"endColumn":70},{"fileId":"fileId-0","selectedText":"GROUP BY Locations.name","startRow":4,"startColumn":0,"endRow":4,"endColumn":23}],"imageURLs":["media/images/1647376985484-Screen Shot 2022-03-15 at 3.42.52 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/q.sql","viewableBlogText":"SELECT Locations.name, (Locations.capacity - COUNT(*)) AS freeCapacity\nFROM Dogs, Locations\nWHERE Dogs.locationId = Locations.id\nAND  adoptedByClientId IS NULL\nGROUP BY Locations.name;","commentTags":["image"],"questionCommentData":null,"commentTitle":""}]};
